from typing import List
from math import sqrt

class Solution:
    def maximumScore(self, nums: List[int], k: int) -> int:
        MOD = 10**9 + 7
        def prime_factors(x):
            factors = set()
            while x % 2 == 0:
                factors.add(2)
                x //= 2
            for i in range(3, int(sqrt(x)) + 1, 2):
                while x % i == 0:
                    factors.add(i)
                    x //= i
            if x > 2:
                factors.add(x)
            return len(factors)

        score = 1
        nums_with_prime_scores = sorted([(prime_factors(num), num) for num in nums], key=lambda x: (-x[0], -x[1]))
        for i in range(min(k, len(nums_with_prime_scores))):
            score = (score * nums_with_prime_scores[i][1]) % MOD

        return score
